import react from 'react';

const Dessert = () => {
  return (
    <div class='container'>
      <h1 class='fw-bolder stagger-item'>FRENCH WAFFLE</h1>
      <hr></hr>
      <h1 class='fw-bolder stagger-item'>CROFFLE</h1>
      <hr></hr>
      <h1 class='fw-bolder stagger-item'>BISCUIT</h1>
      <hr></hr>
    </div>
  );
};

export default Dessert;
